import React, { Component } from 'react';

class AddDino extends Component {
  constructor(props){
    super(props)
    this.state ={
      name: [],
      age: [],
      species: [],
      fed: [],
      eatsMeat: []
    }
  }

render(){
  return(
    <>
      <h4>Add Dino</h4>
      <form>
        <input type="text" placeholder="name" value="name" /><br/>
        <input type="text" placeholder="age" value="age" /><br/>
        <input type="text" placeholder="species" value="species" /><br/>
        <input type="radio" name="fed" value="fed" />fed
        <input type="radio" name="fed" value="not fed" />not fed<br/>
        <input type="radio" name="eatsMeat" value="Carnivore" />Carnivore
        <input type="radio" name="eatsMeat" value="Herbivore" />Herbivore
      </form>
    </>
  );
}
}

export default AddDino;
